                            <h1 class=""site-title  hidden-sm"">فروشگاه اینترنتی نوِنو، بررسی، انتخاب و خرید آنلاین</h1>
                            <h1 class=""site-title d-md-none d-lg-none d-xl-none"" style=""font-size: 14px;"">فروشگاه
                                اینترنتی نوِنو، بررسی، انتخاب و خرید آنلاین</h1>
                            <p>
                              فروشگاه اینترنتی نونو با شعار «اسراف کمتر، وجدان راحت و جهان سالم‌تر» بازاری پویا ایجاد کرده است تا فروشندگان و خریداران گرد هم بیایند و به معامله (خرید، فروش و معاوضه) کالاهای نو استفاده نشده (کالاهای به اصطلاح نوِنو) بپردازند. فروشندگان نونو افرادی هستند که پس از خرید یک کالا بنابر هر دلیلی از خرید خود پشیمان شده‌اند اما امکان مرجوعی کالا برای آنها فراهم نیست؛ و یا کالایی را برای هدف خاصی خریداری کرده‌اند اما به ");
                WriteLiteral(@"کارشان نیامده و بدون حتی یکبار استفاده در انباری و یا منزلشان خاک می‌خورد؛ و یا کالایی را به صورت هدیه دریافت کرده‌اند اما قصد استفاده و یا نگهداری از آن را ندارند. همچنین افرادی که کسب و کار کوچک محلی و خانگی دارند نیز فرصت معرفی و فروش محصولات خود را در نوِنو دارند. خریداران فروشگاه نونو می‌توانند کالاهای کاملا نو مورد نیاز خود را با قیمتی ارزانتر خریداری و در هزینه‌های خود صرفه‌جویی کنند. جهت اطمینان خاطر طرفین معامله، فروشگاه نونو دارای سیستم بازرسی کالا می‌باشد که کالا را از فروشنده دریافت کرده و پس از بازرسی و تایید صحت ادعای فروشنده، آن را به خریدار ارسال می کند.
